import React from "react";
import ReactDOM from "react-dom";
import PrimaryButton, {
  SecondaryButton,
  TertiaryButton,
} from "./components/Buttons";
import { GlobalStyle } from "./utilities";

const App = () => (
  <div>
    <PrimaryButton modifiers={["small", "primaryButtonSuccess"]}>Hello World!</PrimaryButton>
    <SecondaryButton modifiers={["large", "secondaryButtonWarning"]}>
      Hello World!
    </SecondaryButton>
    <TertiaryButton modifiers={[""]}>Hello World!</TertiaryButton>
    <GlobalStyle />
  </div>
);
ReactDOM.render(<App />, document.getElementById("root"));
